['BIRMINGHAM, KOMPAS.com - Pasangan ganda campuran Indonesia, Praveen Jordan/Melati Daeva Oktavianti, memastikan langkah ke babak perempat final  All England Open 2019 setelah mengalahkan wakil Jerman, Mark Lamsfuss/Isabel Herttrich.', 'BIRMINGHAM, KOMPAS.com', 'All England Open 2019', 'Pada laga babak kedua yang digelar di Arena Birmingham, Inggris, Kamis (7/3/2019) atau Jumat dini hari WIB, Praveen/Melati menang atas Mark/Isabel dalam straight game dengan skor 21-11 dan 21-17.', 'straight game', 'Pada gim pertama, Mark/Isabel sempat memimpin terlebih dahulu pada awal laga dengan skor 1-3.', 'Baca juga: Hasil All England Open 2019 - Greysia/Apriyani Kandaskan Wakil China', 'Baca juga: Hasil All England Open 2019 - Greysia/Apriyani Kandaskan Wakil China', 'Hasil All England Open 2019 - Greysia/Apriyani Kandaskan Wakil Chin', 'Namun, Praveen/Melati berhasil menyamakan kedudukan dengan Mark/Isabel dengan skor 4-4.', 'Selepas itu, Praveen/Melati trus memimpin hingga jeda interval yang berakhir dengan skor 11-5.', 'Selepas jeda, pasangan ganda campuran Indonesia terus menambah keunggulan dan mengakhiri gim pertama dengan skor 21-11.', 'Pada gim kedua, Praveen/Melati sempat memimpin hingga skor menjadi 6-3.', 'Pertandingan pada gim kedua ini sempat berjalan ketat. Hingga jeda interval, Mark/Isabel sempat unggul atas Praveen/Melati dengan skor 9-11.', 'Selepas jeda, pasangan Indonesia berhasil menyamakan kedudukan menjadi 12-12 dan 14-14.', 'Selanjutnya, Praveen/Melati terus meraih poin hingga gim kedua berakhir dengan keunggulan 21-17 atas Mark/Isabel.', 'Dengan hasil itu, Praveen Jordan/Melati Daeva Oktavianti melaju ke babak perempat final All England Open 2019.', "
        
