['KOMPAS.com — Kompas.com secara resmi tersertifikasi dalam jaringan internasional penguji fakta (IFCN - International Fact-Checking Network). Di dunia, selain Kompas.com, baru ada 49 lembaga lain yang mendapat sertifikasi ini.', 'KOMPAS.com', 'Kompas.com', 'IFCN - International Fact-Checking Network', 'Kompas.com', '"Di era digital saat ini, masyarakat dihadapkan pada banjir informasi yang serba tidak pasti kebenarannya. Sertifikasi IFCN ini meneguhkan komitmen Kompas.com\xa0yang selalu menguji setiap informasi untuk mencari dan menemukan kebenaran. Dengan upaya ini, hoaks yang marak dan menyamar sebagai informasi bisa dilawan," kata Pemimpin Redaksi Kompas.com Wisnu Nugroho di Jakarta, Rabu (17/10/2018).', 'Kompas.com', 'Kompas.com', '', 'KOMPAS.com/ANDREAS LUKAS ALTOBELI Pemimpin Redaksi Kompas.com Wisnu Nugroho memberikan sambutan saat perayaan HUT Kompas.com di Bentara Budaya Jakarta, Palmerah Selatan, Jakarta, Jumat (14/9/2018). Berbagai acara dan kegiatan meramaikan acara HUT yang ke 23  Kompas.com yang jatuh pada tanggal 14 September.', '', 'KOMPAS.com/ANDREAS LUKAS ALTOBELI', 'Kompas.com', 'Hoaks atau Fakta', 'Kompas.com', "
        
            googletag.cmd.push(function() { googletag.display('div-gpt-ad-974648810682144181-5112'); });
        
    ", "
            googletag.cmd.push(function() { googletag.display('div-gpt-ad-974648810682144181-5112'); });
        ", '', 'Hampir setiap hari, Tim Hoaks atau Fakta Kompas.com melakukan verifikasi dengan turun langsung ke lapangan dan menelusuri sumber-sumber yang kredibel untuk memastikan kebenaran sebuah informasi.', 'Kompas.com', 'Database Hoaks atau Fakta yang ditelusuri Kompas.com bisa dilihat di sini.', 'Kompas.com', 'bisa dilihat di sini', 'Bekerja sama dengan Turnbackhoax.id, Kompas.com juga menerima laporan masyarakat atas sejumlah informasi yang ingin diverifikasi. Formulir laporan masyarakat\xa0bisa dilihat di sini\xa0agar siapa pun bisa berpartisipasi.\xa0', 'Kompas.com', 'bisa dilihat di sini', 'Rubrik khusus ini pula yang menjadi salah satu pertimbangan IFCN memasukkan Kompas.com sebagai jejaring lembaga penguji internasional.', 'Kompas.com', 'Pertimbangan lain yang dijadikan dasar adalah sikap Kompas.com yang non-partisan, transparan dalam sumber pendanaan, dan selalu mengutip sumber-sumber yang kredibel untuk setiap beritanya.', 'Kompas.com', 'Di antara 49 lembaga yang\xa0tersertifikasi dalam jaringan internasional penguji fakta (IFCN -\xa0International Fact-Checking Network), ada lima lembaga dari Indonesia.', 'Lima lembaga itu adalah\xa0Kompas.com,\xa0Tirto.id,\xa0Liputan6.com,\xa0Tempo.co, dan Mafindo (turnbackhoax.id).', 'Kompas.com,\xa0', 'Tirto.id', 'Liputan6.com', 'Tempo.co', "
        
            googletag.cmd.push(function() { googletag.display('div-gpt-ad-974648810682144181-4112'); });
        
