['KOMPAS.com - Jonatan Christie harus mengakhiri kiprahnya dalam turnamen bulu tangkis  All England Open 2019. Tunggal putra Indonesia ini ditaklukkan pemain India, Kidambi Srikanth. ', 'KOMPAS.com', 'All England', 'Dalam pertandingan babak kedua di Birmingham Arena, Inggris, Kamis (7/3/2019), Jonatan kalah rubber game 17-21, 21-11, 12-21. Peraih medali emas Asian Games 2018 ini mengakui, Srikanth tampil lebih baik ketimbang pertemuan mereka sebelumnya dalam ajang Indonesia Masters 2019 di mana Jonatan menang.', 'Baca Juga: Hasil All England 2019, Jonatan Christie Disingkirkan Wakil India', 'Baca Juga: Hasil All England 2019, Jonatan Christie Disingkirkan Wakil India', 'Hasil All England 2019, Jonatan Christie Disingkirkan Wakil India', '"Hari ini Srikanth main lebih bagus, tidak banyak melakukan kesalahan sendiri. Dia bisa menerapkan strategi yang tepat melawan saya," kata Jonatan setelah pertandingan, dikutip dari Badmintonindonesia.org.', '"Saya tahu dia akan melepas game kedua, dia sudah punya plan di game ketiga dan mempersiapkan tenaga. Tapi pada kedudukan 2-1 di game ketiga, saya merasa kulit jari kaki telunjuk kiri saya sobek dan agak berdarah. Sebetulnya saya sudah coba tahan, tapi perih sekali dan ini berpengaruh ke pergerakan saya yang jadi lebih lambat," kata Jonatan.', 'Jonatan juga mengatakan bahwa ia tak tampil dalam permainan terbaiknya. Ia banyak melakukan kesalahan-kesalahan tak perlu yang akhirnya menambah perolehan angka untuk lawan.', 'Baca Juga: Ranking Jonatan Naik, 3 Tunggal Putra Indonesia Tempati 10 Besar Dunia', 'Baca Juga: Ranking Jonatan Naik, 3 Tunggal Putra Indonesia Tempati 10 Besar Dunia', 'Ranking Jonatan Naik, 3 Tunggal Putra Indonesia Tempati 10 Besar Dunia', '"Dalam pertandingan kali ini saya banyak membuat kesalahan sendiri, banyak mati sendiri, yang seharusnya tidak saya lakukan," tambahnya.', 'Dengan hasil ini, sektor tunggal putra menyisakan Tommy Sugiarto yang lolos ke babak perempat final. Tommy melaju ke babak delapan besar setelah mengalahkan Huang Yuxiang (China) dengan skor 22-24, 21-17, 21-16 dan akan melawan pemain Hong Kong, Ng Ka Long Angus, yang menyingkirkan Anthony Sinisuka Ginting pada babak pertama.', "
        
            googletag.cmd.push(function() { googletag.display('div-gpt-ad-974648810682144181-4112'); });
        
