['KOMPAS.com - Ganda putri Indonesia,  Ni Ketut Mahadewi Istarani/ Rizki Amelia Pradipta, melangkah ke babak perempat final turnamen bulu tangkis  All England Open 2019. Tiket itu diraih setelah menang atas wakil Korea Selatan, Chang Ye Na/Jung Kyung Eun, dengan skor 21-18, 21-14.', 'KOMPAS.com', 'Ni Ketut Mahadewi Istarani', 'Rizki Amelia Pradipta', 'All England', 'Ketut/Rizki mengakui, Chung/Jung tak tampil dalam permainan terbaiknya pada laga babak kedua di Birmingham Arena, Inggris, Kamis (7/3/2019). Pada gim kedua, Ketut/Rizki bahkan tak perlu waktu lama untuk menghentikan perlawanan ganda putri senior Negeri Ginseng tersebut.', 'Baca Juga: Hasil All England 2019, Ketut/Rizki Melaju ke Perempat Final', 'Baca Juga: Hasil All England 2019, Ketut/Rizki Melaju ke Perempat Final', 'Hasil All England 2019, Ketut/Rizki Melaju ke Perempat Final', '"Alhamdulillah kali ini bisa main maksimal, dari awal kami memang langsung in, fokus satu demi satu poin dan jangan lengah. Kali ini lawan tampil kurang bagus, mereka banyak melakukan kesalahan sendiri," ujar Rizki usai permainan, dikutip dari Badmintonindonesia.org.', 'Padahal, Chang/Jung membuat kejutan besar pada babak pertama. Mereka melewati laga panjang saat mengalahkan unggulan kedua dari Jepang, Misaki Matsutomo/Ayaka Takahashi, dengan skor 21-17, 10-21, 21-19. \xa0', '"Hari ini mereka bermain dalam tekanan, mungkin karena kemarin bermain ramai melawan Misaki/Ayaka. Pasangan Korea dan Jepang tipe mainnya sama, ada menyerangnya, kalau Jepang kan safe banget," ujar Ketut.', 'Baca Juga: Hasil Lengkap All England 2019, Ada 7 Wakil Indonesia ke Babak 8 Besar', 'Baca Juga: Hasil Lengkap All England 2019, Ada 7 Wakil Indonesia ke Babak 8 Besar', 'Hasil Lengkap All England 2019, Ada 7 Wakil Indonesia ke Babak 8 Besar', 'Kemenangan Ketut/Rizki membuat Indonesia memiliki dua ganda putri pada babak perempat final. Pasangan terbaik Tanah Air, Greysia Polii/Apriyani Rahayu, juga lolos setelah ungguan keempat ini menang straight game atas Dong Wenjing/Feng Xuenying (China), dengan skor 21-10, 21-12.', 'Pada babak perempat final hari ini, Ketut/Rizki bertemu unggulan ketujuh dari Jepang, Shiho Tanaka/Koharu Yonemoto. Ketut/Rizki unggul 1-0 dalam rekor pertemuan di mana kemenangan itu terjadi dalam Malaysia Masters 2019 pada 16 Januari.', 'Sementara itu, Greysia/Apriyani kembali bertemu rivalnya dari China, Chen Qingchen/Jia Yifan, yang merupakan unggulan kelima.', "
        
