['JAKARTA,  KOMPAS.com -  Kompas.com mendapat penghargaan  Superbrands untuk kategori Berita Online Terpercaya (Trusted Online News). Penghargaan diberikan pada Gala Awards Night 2018 yang digelar di Hotel JW Marriot, Jakarta, Jumat (27/7/2018) malam.', 'JAKARTA,  KOMPAS.com', 'KOMPAS.com', ' Kompas.com', 'Kompas.com', 'Superbrands', 'Mewakili Kompas.com, Pemimpin Redaksi Kompas.com\xa0Wisnu Nugroho menerima secara simbolik penghargaan tersebut dari CEO Superbrands Indonesia Grandtyana Mayasari. ', 'Kompas.com', 'Kompas.com\xa0', ' Saat ditemui di sela-sela acara, Wisnu menyampaikan terima kasih kepada para pembaca Kompas.com yang menaruh kepercayaan pada berita-berita yang diproduksi jurnalis dan tim redaksi Kompas.com. ', 'Kompas.com', 'Kompas.com', ' "Ini adalah bonus atas upaya Kompas.com menjaga kepercayaan pembaca kepada kami," ujar Wisnu Nugroho, usai menerima penghargaan.', 'Kompas.com', 'Baca juga: VIK Kompas.com Raih Penghargaan Internasional Asian Digital Awards', 'Baca juga: VIK Kompas.com Raih Penghargaan Internasional Asian Digital Awards', 'VIK Kompas.com Raih Penghargaan Internasional Asian Digital Awards', ' Wisnu menilai penghargaan tersebut akan memacu Kompas.com untuk bekerja lebih baik lagi, terutama untuk menjadi referensi berita terpercaya di tengah banjirnya informasi akhir-akhir ini.', 'Kompas.com', ' "Kompas.com akan terus berusaha menjadi sumber berita terpercaya di tengah banjir informasi," sebutnya.', 'Kompas.com', 'Menurut Wisnu, dengan menjadi sumber berita terpercaya, berita Kompas.com\xa0diharapkan dapat membantu pembaca menemukan kepastian di tengah ketidakpastian karena banjir informasi yang munculkan disinformasi (hoaks).', 'Kompas.com', 'Baca juga:\xa0Jurnalis Kompas.com Raih Juara Kontes Infografis pada Workshop Visualisasi Data', 'Baca juga:\xa0Jurnalis Kompas.com Raih Juara Kontes Infografis pada Workshop Visualisasi Data', 'Jurnalis Kompas.com Raih Juara Kontes Infografis pada Workshop Visualisasi Data', 'Apresiasi kepada pelaku industri', 'Apresiasi kepada pelaku industri', 'Dalam acara ini, ada puluhan produk yang mendapat penghargaan sebagai yang terbaik di kategorinya masing-masing.', 'Grandtyana Mayasari menyatakan, pemberian penghargaan tersebut merupakan bentuk apresiasi Superbrands Indonesia kepada pelaku industri.', 'Menurut dia, keberhasilan mencipatkan produk dan menerapkan strategi marketing yang tepat berdampak signifikan terhadap merk masing-masing. ', ' "Superbrands terus berupaya untuk menaikkan nilai jual logo Superbrands sehingga merk yang membawanya juga akan meningkat nilainya di mata konsumen," kata Grandtyana. ', "
        
