['JAKARTA, KOMPAS.com - Pelatih tim nasional U-23 Indonesia,  Indra Sjafri memuji salah satu pemainnya,  Marinus Wanewar. Ia bahkan menilai Marinus sebagai orang baik yang jarang ditemui di Indonesia.', 'JAKARTA, KOMPAS.com', 'Indra Sjafri', 'Marinus Wanewar', 'Hal itu disampaikan Indra mengacu pada keputusan Marinus yang menggelontrkan bonus Rp 200 juta untuk memperbaiki gereja di desanya di Papua. Itu adalah bonus yang diberikan Presiden Joko Widodo untuk skuad timnas yang menjuarai  Piala AFF U-22 di Kamboja, akhir Februari lalu.', 'Piala AFF U-22', '"Siapa bilang Marinus bukan anak baik. Dapat bonus Rp 200 juta, dia perbaiki gereja. Ada enggak orang di Indonesia yang seperti itu. Jarang," kata Indra dalam wawancara eksklusif bersama Kompas.com dan BolaSport.com, di Jakarta, Selasa (5/3/2019).', 'Baca juga: Wawancara Eksklusif, Indra Sjafri Buka-bukaan Soal Keberhasilan Timnas Juarai Piala AFF U-22 ', 'Baca juga: Wawancara Eksklusif, Indra Sjafri Buka-bukaan Soal Keberhasilan Timnas Juarai Piala AFF U-22 ', 'Wawancara Eksklusif, Indra Sjafri Buka-bukaan Soal Keberhasilan Timnas Juarai Piala AFF U-22 ', '"Jadi kalau orang bilang dia jelek, saya adalah orang yang bilang dia anak baik. Makanya ada hastag anak baik," ujar Indra.', '', 'KOMPAS.COM/FERRIL DENNYS Ekspresi pelatih tim nasional U-23 Indonesia, Indra Sjafri, dalam wawancara eksklusif dengan Kompas.com di Jakarta, Selasa (5/3/2019). ', '', 'KOMPAS.COM/FERRIL DENNYS', 'Sebelum bergabung di tim asuhan Indra Sjafri, Marinus dikenal sebagai pemain yang kerap tampil emosional. Namun di bawah tangan Indra, ia bisa tampil tenang dan menyabet gelar top scorer pada Piala AFF U-22 2019.', 'Menurut Indra, dirinya sudah mempelajari karakter Marinus berdasarkan hasil psikotest. Karena itu, ia tak begitu saja percaya dengan opini banyak orang.', 'Baca juga:\xa0Juara Piala AFF U-22, 4 Pertanyaan untuk Marinus, Sang Top Scorer', 'Baca juga:\xa0Juara Piala AFF U-22, 4 Pertanyaan untuk Marinus, Sang Top Scorer', 'Juara Piala AFF U-22, 4 Pertanyaan untuk Marinus, Sang Top Scorer', '"Dokter Joe Rumeser mengatakan Marinus itu perlu tokoh yang bisa dia percaya. Oleh sebab itu saya orang yang dia percaya. Kalau dia sudah percaya ke saya, bilang ke A pasti dia lakukan A," lanjut Indra.', '"Tapi saya juga harus menjaga diri. Saya bilang 'Marinus, kamu tidak boleh keluar malam dan saya tidak pernah keluar malam'. Marinus, kamu harus rajin ke gereja, saya rajin ke masjid. Jadi dia ada yang dia contoh. Ada yang dia percayai. Tidak mungkin orang percaya ke kita dia tidak patuh ke kita. Itu yang saya lakukan"', '"(Saat bertemu Presiden) tahu enggak apa yang dia bilang ke Presiden 'Pak, tolong perbaiki jalan kampung saya'. Gila enggak itu," pungkas Indra.', 'Baca juga:\xa0Ditanya Jokowi Ingin Apa? Marinus Minta Perbaikan Jalan di Kampungnya di Papua', 'Baca juga:\xa0Ditanya Jokowi Ingin Apa? Marinus Minta Perbaikan Jalan di Kampungnya di Papua', 'Ditanya Jokowi Ingin Apa? Marinus Minta Perbaikan Jalan di Kampungnya di Papua', '', '', '', '', "
        
