['JAKARTA, KOMPAS.com - Pelatih tim nasional U-23 Indonesia  Indra Sjafri menyatakan dirinya pasti akan mendepak pemain yang berkelakuan seperti Kepa Arrizabalaga.', 'JAKARTA, KOMPAS.com', 'Indra Sjafri', 'Kepa adalah kiper Chelsea yang belum lama ini membuat heboh. Saat turun di Final Piala Liga, 24 Februari lalu, Kepa menolak diganti dengan kiper lainnya, Willy Caballero.', 'Pada laga tersebut, Chelsea kalah adu penalti dari Manchester City.', '"Kalau saya, saya putuskan kontrak dia. Kalau ada pemain saya, jangankan dia menolak diganti, dia diganti terus dia keluar dengan muka yang enggak enak, paginya saya buang itu," kata Indra dalam wawancara eksklusif bersama Kompas.com dan BolaSport.com, di Jakarta, Selasa (5/3/2019).', 'Kompas.com', 'BolaSport.com', 'Baca juga: Wawancara Eksklusif, Indra Sjafri Buka-bukaan Soal Keberhasilan Timnas Juarai Piala AFF U-22 ', 'Baca juga: Wawancara Eksklusif, Indra Sjafri Buka-bukaan Soal Keberhasilan Timnas Juarai Piala AFF U-22 ', 'Wawancara Eksklusif, Indra Sjafri Buka-bukaan Soal Keberhasilan Timnas Juarai Piala AFF U-22 ', '', 'ADRIAN DENNIS / AFP Kiper Chelsea, Kepa Arrizabalaga, menunjukkan gestur menolak ditarik keluar lapangan dalam laga melawan Manchester City di final Piala Liga Inggris, 24 Februari 2019.', '', 'ADRIAN DENNIS / AFP', 'Kejadian menolak digantinya Kepa bermula saat ia mendapat perawatan dari tim medis Chelsea karena keram. Beberapa orang dari tim medis tersebut kemudian kembali ke bangku pemain dan menyarankan Kepa untuk diganti.', 'Pelatih Maurizio Sarri menuruti rekomendasi dari tim medis dan meminta kiper cadangan Caballero untuk bersiap. Saat wasit keempat hendak mengangkat papan pergantian pemain, Kepa tiba-tiba mengirim pesan ke bangku pemain bahwa dirinya baik-baik saja. Kepa meminta untuk tetap bermain dan tidak diganti.', 'Melihat Kepa menolak diganti, Sarri marah besar hingga sempat meninggalkan bangku pemain ke ruang ganti sebelum kembali lagi.', 'Baca juga: Tindakan Kontroversial Kepa Arrizabalaga Bikin Chelsea Makin Kompak', 'Baca juga: Tindakan Kontroversial Kepa Arrizabalaga Bikin Chelsea Makin Kompak', 'Tindakan Kontroversial Kepa Arrizabalaga Bikin Chelsea Makin Kompak', "
        
