['KOMPAS.com - Mantan Presiden  Real Madrid, Ramon Calderon, menyatakan bahwa  Zinedine Zidane telah menolak tawaran untuk kembali menukangi klub raksasa Spanyol itu.', 'KOMPAS.com', 'Real Madrid', 'Zinedine Zidane', 'Sebelumnya, Presiden Real Madrid  Florentino Perez dikabarkan memanggil Zidane untuk menggantikan posisi  Santiago Solari yang telah gagal mengantarkan El Real melaju ke perempat final Liga Champions.', 'Florentino Perez', 'Santiago Solari', 'Namun, harapan Real Madrid untuk mendapatkan kembali Zidane tampaknya tidak akan terwujud. Sebab, menurut Ramon Calderon, pelatih berpaspor Perancis itu telah menolak tawaran yang diajukan Florentino Perez.', '"Saya tahu pagi ini presiden (Florentino Perez) telah memanggil Zidane untuk kembali, tapi dia mengatakan tidak sekarang," ujar Ramon Calderon, dilansir BBC, Kamis (7/3/2019).', 'BBC', '"Dia telah membuka kemungkinan kembali pada Juni nanti," kata dia melanjutkan.', 'Zidane meninggalkan Real Madrid pada musim panas tahun lalu atau tepatnya lima hari setelah membawa timnya meraih gelar Liga Champions 2017/2018.', 'Baca juga: Casemiro Sebut Solari Mirip dengan Zidane dalam Hal Pendekatan', 'Baca juga: Casemiro Sebut Solari Mirip dengan Zidane dalam Hal Pendekatan', 'Casemiro Sebut Solari Mirip dengan Zidane dalam Hal Pendekatan', 'Dia menjadi pelatih pertama yang berhasil meraih gelar Liga Champions dalam tiga musim beruntun.', 'Pelatih berusia 46 tahun itu kemudian memilih menganggur setelah meninggalkan Real Madrid. Hingga kini, Zidane belum memutuskan untuk kembali menjalani karier sebagai pelatih klub.', 'Florentino Perez dirumorkan ingin membawa Zidane kembali untuk memperbaiki nasib Real Madrid musim ini.', 'Baca juga: Lahirnya Real Madrid, Bermula dari Perpecahan hingga Dapat Dukungan Raja', 'Baca juga: Lahirnya Real Madrid, Bermula dari Perpecahan hingga Dapat Dukungan Raja', 'Lahirnya Real Madrid, Bermula dari Perpecahan hingga Dapat Dukungan Raja', 'Madrid memang terseok-seok setelah ditinggalkan Zidane. Pergantian pelatih dari Julen Lopetegui ke Santiago Solari belum mampu meningkatkan performa Madrid.', 'Klub raksasa Spanyol itu sudah tersingkir dari perebutan gelar Copa del Rey dan Liga Champions pada pekan ini. Mereka juga terancam tidak bisa menjuarai Liga Spanyol karena tertinggal terlalu jauh dari Barcelona yang memimpin klasemen sementara.', 'Kekalahan memalukan 1-4 dari Ajax Amsterdam pada laga leg kedua babak 16 besar Liga Champions di Stadion Santiago Bernabeu, Selasa (5/3/2019), disebut-sebut bakal membuat Solari didepak dari kursi pelatih Real Madrid.', '\xa0', "
        
