['JAKARTA, KOMPAS.com - Kapolri Jenderal Polisi, Tito Karnavian, memimpin kenaikan pangkat luar biasa (KPLB) dua pemain tim nasional U-22, Briptu Rizki Sani Fauzi dan Briptu  Awan Setho Raharjo, di Mabes Polri, Jakarta, Selasa (5/3/2019).', 'JAKARTA, KOMPAS.com', 'Awan Setho', 'Sani dan Awan merupakan anggota skuad saat juara Piala AFF U-22 2019 di Kamboja, akhir Februari lalu. Keduanya juga merupakan anggota kepolisian.', 'Sani adalah anggota Sat Brimobda Polda Metro Jaya. Pemain yang berposisi sebagai gelandang itu turut mencetak gol saat timnas menang 2-1 atas Thailand di pertandingan final di Stadion Olimpiade Phnom Penh, Kamboja, Selasa (26/2/2019).', 'Baca juga: Latihan Perdana Setelah Juara, Timnas U-22 Kini Disebut Timnas U-23', 'Baca juga: Latihan Perdana Setelah Juara, Timnas U-22 Kini Disebut Timnas U-23', 'Latihan Perdana Setelah Juara, Timnas U-22 Kini Disebut Timnas U-23', 'Sedangkan Awan merupakan anggota Biro SDM Polda Jawa Tengah. Ia berposisi sebagai penjaga gawang.', 'Sejumlah petinggi Polri lainnya ikut serta dalam acara tersebut. Turut hadir pula Manajer AKBP Sumardji, dan Pelatih Indra Sjafri.', 'Dalam Upacara ini, Tito menyampaikan ucapan terima kasih kepada Sani dan Awan atas prestasinya yang bukan hanya mengharumkan nama Polri, tetapi juga turut mengharumkan nama Indonesia di kancah Sepak Bola Internasional.', 'Baca juga: Anggota Skuad Juara AFF U-22 Tak Otomatis Masuk Timnas U-23', 'Baca juga: Anggota Skuad Juara AFF U-22 Tak Otomatis Masuk Timnas U-23', 'Anggota Skuad Juara AFF U-22 Tak Otomatis Masuk Timnas U-23', 'Atas prestasinya tersebut, Tito memberikan kenaikan pangkat luar biasa kepada mereka berdua dari yang sebelumnya Brigadir Polisi Dua menjadi Brigadir Polisi Satu.', '"Saya merasa sangat bangga ada dua anggota Polri yang ada disana, bukan hanya sebagai pemain biasa tetapi juga ada yang mencetak gol. Sehingga ini menggerakkan saya selaku pimpinan Polri untuk menyampaikan penghargaan dalam bentuk Kenaikan Pangkat Luar Biasa" kata Tito dikutip dari keterangan tertulis Mabes Polri.', '\xa0', '\xa0', "
        
