['', '', 'KOMPAS.com -  Manchester United berhasil memastikan langkah ke perempat final  Liga Champions setelah menyingkirkan  Paris Saint-Germain ( PSG) dengan agregat 3-3.', 'KOMPAS.com', 'Manchester United', 'Liga Champions', 'Paris Saint-Germain', 'PSG', 'Manchester United berhasil mencuri kemenangan 3-1 saat bertandang ke markas PSG, Stadion Parc des Princes, pada laga leg kedua babak 16 besar, Rabu (6/3/2019) atau Kamis dini hari WIB.', "Dua gol dari Romelu Lukaku (2' dan 30') serta tendangan penalti dari Marcus Rashford (90'+2) membuat Setan Merah berhak atas tiket ke perempat final setelah kalah 0-2 dari PSG pada\xa0\xa0laga leg pertama di Old Trafford, 13 Februari 2019 lalu.", 'Manchester United unggul dalam agresivitas gol tandang atas PSG meski kedua tim ini mengemas agregat imbang 3-3.', 'Di sisi lain, sebiji gol balasan yang dicetak Juan Bernat dengan memanfaatkan assist Kylian Mbappe pada menit ke-12 belum cukup menjadi jaminan PSG untuk lolos ke perempat final.', 'assist', 'Agregat menjadi 3-3. Namun, PSG tersisih karena kalah dalam agresivitas gol tandang.', 'Baca juga: Hasil Liga Champions, Singkirkan PSG, Manchester United Melaju', 'Baca juga: Hasil Liga Champions, Singkirkan PSG, Manchester United Melaju', 'Baca juga: Hasil Liga Champions, Singkirkan PSG, Manchester United Melaju', 'Hasil Liga Champions, Singkirkan PSG, Manchester United Melaju', 'PSG sebenarnya berpeluang mengatasi ketertinggalan pada laga ini saat tendangan Angel di Maria menerobos masuk gawang Man United.', 'Sementara itu,  Porto juga berhasil meraih satu tiket perempat final setelah mengandaskan  AS Roma pada laga leg kedua babak 16 besar.', 'Porto', 'AS Roma', 'Bertanding di Stadion do Dragao, Porto meraih kemenangan 3-1 atas Roma setelah melalui babak perpanjangan waktu. Porto pun melaju dengan mengantongi agregat 4-3 atas Roma.', 'Baca juga: Porto Vs AS Roma, Gol Alex Telles Loloskan Porto ke Perempat Final', 'Baca juga: Porto Vs AS Roma, Gol Alex Telles Loloskan Porto ke P