['KOMPAS.com - Pelatih tim nasional U-23 Indonesia,  Indra Sjafri, bakal mencoret  Ezra Walian jika pemain naturalisasi asal Belanda tersebut tidak hadir dalam pemusatan latihan untuk Kualifikasi Piala Asia U-23 2020 pada 22-26 Maret mendatang di Vietnam.', 'KOMPAS.com -', 'Indra Sjafri', 'Ezra Walian', 'Ezra Walian masuk dalam 30 nama pemain yang dipanggil Indra Sjafri untuk mengikuti pemusatan latihan. Sebanyak 23 nama merupakan anggota skuat timnas U-22 Indonesia yang berhasil meraih juara Piala AFF U-22 2019, sisanya tujuh pemain baru.', 'Mereka adalah Egy Maulana Vikri, Saddil Ramdani, Ezra Walian, TM Ichsan, Mahir Radja, Kadek Raditya, dan Feby Eka Putra. Dari ketujuh pemain tersebut, tinggal Egy Maulana Vikri, Saddil Ramdani, dan Ezra Walian yang belum juga hadir di tengah-tengah Andy Setyo dkk.\xa0', 'Baca juga: Juara Piala AFF U-22, 4 Pertanyaan untuk Marinus, Sang Top Scorer', 'Baca juga: Juara Piala AFF U-22, 4 Pertanyaan untuk Marinus, Sang Top Scorer', 'Juara Piala AFF U-22, 4 Pertanyaan untuk Marinus, Sang Top Scorer', 'Indra Sjafri mengatakan, untuk Egy Maulana Vikri dan Saddil Ramdani sudah ada kejelasan kapan bergabung bersama timnas U-23 Indonesia.', 'Sementara untuk Ezra Walian, Indra Sjafri belum mengetahui kabar terbaru dari pemain yang saat ini berlaga di kasta kedua Liga Belanda bersama RKC Waalwijk.', '"Ezra Walian saya tidak tahu entah di mana dia sekarang. Enggak ada kabar soalnya," kata Indra Sjafri di Lapangan ABC, Senayan, Jakarta Pusat, Selasa (5/3/2019).', 'Pemanggilan Indra Sjafri ini bukan untuk pertama kali bagi Ezra Walian.', 'Sebelumnya, pemain naturalisasi itu sempat diminta hadir saat timnas U-22 Indonesia menggelar pemusatan latihan jelang berlaga di Piala AFF U-22 2019. Akan tetapi, Ezra Walian tidak bisa datang karena pihak klub enggan melepasnya ke timnas U-22 Indonesia lantaran Piala AFF bukan merupakan agenda FIFA.', 'Belum hadirnya Ezra Walian membuat Indra Sjafri hanya punya dua penyerang yang berlatih bersama timnas U-23 Indonesia, yaitu Marinus Wanewar dan Dimas Drajad.', '"Saya sudah memberikan dua kali kesempatan kepada Ezra Walian," kata Indra Sjafri.', '"Kalau minggu ini dia tidak juga ada, dia keluar," tutur mantan pelatih Bali United tersebut.', "
        
