['LOS ANGELES, Kompas.com - Bintang Los Angeles Lakers, LeBron James\xa0 menggeser posisi  Michael Jordan di posisi empat sebagai penghasil poin terbanyak sepanjang sejarah Liga NBA.', 'LOS ANGELES, Kompas.com -', 'Michael Jordan', 'LeBron mencatat prestasi fenomenal ini saat LA Lakers dikalahkan tamunya, Denver Nuggets 62-78. Ia menyamai perolehan Jordan sebanyak 32.292 poin dalam 12 poin pertama.\xa0 Ia kemudian menambahkan 9 poin lagi untuk memastikan rekor sementaranya adalah 33.001 poin.', 'Sesudah memecahkan rekor Jordan, LeBron menutup wajahnya dengan handuk untuk menutupi tangisnya. "Ini seperti hal yang tidak nyata," tulisnya melalui twitter.', 'LeBron yang telah berusia 34 tahun mencapai rekornya tersebut setelah melalui 1.190 gim setelah bermain bersama Miami Heat, Cleveland Cavaliers dan Lakers.\xa0 Sementara\xa0 Jordan mencapainya dalam 1.072 gim bersama\xa0 Chicago Bulls dan Washington Wizards.', 'Dengan perolehan ini, LeBron mengincar posisi tiga yang kini ditempati legenda Lakers lainya, Kobe Bryant dengan 33.643 poin.', 'Peringkat pertama masih ditempati legenda Lakers lainnya, Kareem Abdul-Jabbar dengan 38.387 poin serta bintang Utah Jazz Karl Malone di peringkat dua dengan 36.928 poin.', "Berikut peringkat 10 besar pencetak poin terbanyak NBA1.\xa0\xa0 \xa0Kareem Abdul-Jabbar\xa0\xa0 \xa038,3872.\xa0\xa0 \xa0Karl Malone\xa0\xa0 \xa036,9283.\xa0\xa0 \xa0Kobe Bryant\xa0\xa0 \xa033,6434.\xa0\xa0 \xa0LeBRON JAMES\xa0\xa0 \xa033,0015.\xa0\xa0 \xa0Michael Jordan\xa0\xa0 \xa032,2926.\xa0\xa0 \xa0Wilt Chamberlain\xa0\xa0 \xa031,4197.\xa0\xa0 \xa0DIRK NOWITZKI\xa0\xa0 \xa031,3628.\xa0\xa0 \xa0Shaquille O'Neal\xa0\xa0 \xa028,5969.\xa0\xa0 \xa0Moses Malone\xa0\xa0 \xa027,40910.\xa0\xa0 \xa0Elvin Hayes\xa0\xa0 \xa027,313", 'Berikut peringkat 10 besar pencetak poin terbanyak NBA', '', '', '', '', '', '', '', '', '', '', "
        
