['KOMPAS.com - Babak semifinal Indonesia Basketball League ( IBL) musim 2018-2019 mempertemukan  Pacific Caesar Surabaya dan  Stapac Jakarta di Gelanggang Mahasiswa Soemantri Brodjonegoro, Kuningan, Jakarta, 8-10 Maret 2019 mendatang.', 'KOMPAS.com', 'IBL', 'Pacific Caesar Surabaya', 'Stapac Jakarta', 'Pacific Caesar Surabaya sudah mengantisipasi pertemuan tersebut.', '"Kami akan berhadapan dengan tim terbaik di babak reguler. Pacific akan terus bekerja keras sampai hasil pertandingan memutuskan kami harus berhenti dari kompetisi musim ini," kata pelatih Pacific, Kencana Wukir.', 'Pacific Caesar membuat kejutan dengan mengalahkan Pelita Jaya untuk memastikan diri lolos ke babak semifinal.', 'Kapten tim, Muhammad Hardian Wicaksono, mengatakan, kemenangan itu membuktikan tidak ada yang mustahil.', 'Baca juga: Semifinal IBL, Satria Muda Siap Balas Dendam kepada NSH', 'Baca juga: Semifinal IBL, Satria Muda Siap Balas Dendam kepada NSH', 'Semifinal IBL, Satria Muda Siap Balas Dendam kepada NSH', '"Tugas belum selesai. Kami akan berusaha keras melawan Stapac. Segala sesuatu bisa terjadi di atas lapangan," ujarnya.', 'Sementara itu, pelatih Stapac Jakarta, Giedrius Zibenas, menilai posisi juara divisi dan langsung menuju semifinal bukanlah sebuah keuntungan bagi timnya.', '"Dengan istirahat tak bermain di babak play-off, kami harus menjaga semangat bertanding anak-anak. Salah satunya dengan melakukan scrimmage untuk menjaga naluri bertanding para pemain," kata Zibenas.', 'play-off', 'scrimmage', 'Dia pun belum puas dengan menjadi peringkat pertama di babak reguler.', '"Tujuan kami adalah juara," ucapnya lagi. (Lariza Oky Adisty)', "
        
