['BIRMINGHAM, KOMPAS.com - Pebulu tangkis ganda putri Indonesia,  Ni Ketut Mahadewi Istarani, terpaksa merayakan hari raya Nyepi tanpa didampingi keluarganya. Saat ini, dia tengah berjuang pada turnamen  All England Open 2019.', 'BIRMINGHAM, KOMPAS.com', 'Ni Ketut Mahadewi Istarani', 'All England Open 2019', 'Nyepi yang merupakan hari raya umat Hindu di Indonesia jatuh pada Kamis (7/3/2019). Bagi Ni Ketut, merayakan Nyepi tanpa berkumpul bersama keluarga tentu membuatnya sedih.', 'Meski demikian, pada saat yang bersamaan, dia juga merasa bangga karena bertugas mengharumkan nama bangsa dalam turnamen bulu tangkis bergengsi di dunia itu.', 'Baca juga: PSG Vs Man United, Solskjaer Puji Tahith Chong dan Mason Greenwood', 'Baca juga: PSG Vs Man United, Solskjaer Puji Tahith Chong dan Mason Greenwood', 'PSG Vs Man United, Solskjaer Puji Tahith Chong dan Mason Greenwood', '"Memang ada perasaan sedih, tetapi ada juga senangnya," kata Ni Ketut saat dihubungi pada Rabu (6/3/2019).', '"Sedihnya, enggak bisa kumpul keluarga. Akan tetapi, saya juga senang karena pada hari raya Nyepi bisa berjuang untuk Indonesia," ucap dara kelahiran Tabanan, Bali, pada 24 tahun silam itu.', 'Ni Ketut menyatakan, membela negara sama seperti halnya dengan beribadah. Oleh karena itu, dia mengaku tak masalah meski harus merayakan Nyepi di Inggris.', '"Bela negara juga sama dengan halnya kita beribadah, jadi enggak masalah untuk itu," kata Ni Ketut.', '"Bagi yang bisa melakukan, ya silakan lakukan. Namun, kalau memang ada hal-hal penting seperti ini, pastinya kita harus tahu mana yang perlu didahulukan," katanya.', 'Pada All England tahun ini, Ni Ketut berpasangan dengan Rizki Amelia Pradipta. Mereka menjadi salah satu wakil Indonesia yang berhasil menembus babak kedua.', 'Ni Ketut/Rizki lolos ke babak kedua setelah dinyatakan menang retired atas pasangan Denmark,\xa0Maiken Fruergaard/Sara Thygesen.', 'retired', 'Baca juga: Ketika Batistuta Tak Masalah Anaknya Bekerja di Tempat Fotokopi...', 'Baca juga: Ketika Batistuta Tak Masalah Anaknya Bekerja di Tempat Fotokopi...', 'Ketika Batistuta Tak Masalah Anaknya Bekerja di Tempat Fotokopi...', 'Selanjutnya, Ni Ketut/Rizki akan menghadapi pasangan Korea Selatan, Chang Ye-na/Jung Kyung-eun, yang sukses menaklukkan unggulan kedua asal Jepang, Misaki Matsutomo/Ayaka Takahashi.', 'Chang/Jung yang merupakan non-unggulan sukses mengalakan Matsutomo/Takahashi dengan kedudukan rubber game 21-17, 10-21, dan 21-19.', 'rubber game', "
        
