['KOMPAS.com - Langkah pebulu tangkis tunggal putra senior asal China,  Lin Dan, harus terhenti di babak pertama  All England Open 2019, Rabu (6/3/2019).', 'KOMPAS.com', 'Lin Dan', 'All England', 'Lin Dan melakoni laga perdananya di Arena Birmingham, London, Inggris, dengan cukup mengejutkan.', 'Pebulu tangkis berjuluk "Super Dan" tersebut tunduk dari tunggal putra asal Jepang, Kanta Tsuneyama.', 'Bermain taktis dan cemerlang pada gim pertama, nyatanya tak memudahkan langkah Lin Dan untuk menyelesaikan pertandingan dalam dua gim saja.', 'Baca juga: Marcus/Kevin Langsung Tersingkir pada Babak Pertama All England 2019', 'Baca juga: Marcus/Kevin Langsung Tersingkir pada Babak Pertama All England 2019', 'Marcus/Kevin Langsung Tersingkir pada Babak Pertama All England 2019', 'Lin Dan yang telah unggul 20-14 sempat hampir ditikung oleh Tsuneyama hingga skor pada gim pertama berakhir 21-19 untuk kemenangan Lin Dan.', 'Meski telah mengantongi gim pertama, momentum hilang fokus pada akhir gim tersebut tampaknya belum hilang dari Lin Dan.', 'Hal ini terbukti pada gim kedua, Lin Dan tertinggal jauh dari Tsuneyama hingga skor 9-19 dan gim kedua pun menjadi milik Tsuneyama.', 'Memasuki gim ketiga, penampilan Lin Dan semakin terlihat menurun.', 'Baca juga: Jadwal All England 2019, 8 Wakil Indonesia Berlaga di Babak Kedua', 'Baca juga: Jadwal All England 2019, 8 Wakil Indonesia Berlaga di Babak Kedua', 'Jadwal All England 2019, 8 Wakil Indonesia Berlaga di Babak Kedua', 'Peraih dua medali emas Olimpiade itu pun akhirnya kalah dari Tsuneyama dengan skor akhir 21-19, 14-21, dan 7-21.', '"Saya merasa semakin sulit memfokuskan konsentrasi saya pada akhir babak pertama," kata Lin Dan dikutip dari Xinhua.', 'Xinhua', '"Setelah konsentrasi saya buyar, akan sulit untuk mendapatkannya kembali," ujarnya.', 'Kekalahan Lin Dan dari Tsuneyama membuktikan betapa persaingan di setiap kompetisi makin sengit, palagi periode pengumpulan poin menuju Olimpiade 2020 bakal segera dimulai.', '"Setiap pemain berjuang sangat keras untuk memenangi lebih banyak poin karena Olimpiade makin dekat," ucap Lin Dan.', '"Saya akan lebh banyak mengikuti turnamen untuk menambah peringkat saya," ucap Lin Dan lagi.', 'Turnamen terderkat selanjutnya yang bakal diikuti oleh Lin Dan ialah Swiss Open 2019 (12-17 Maret). Pada babak pertama, dia akan berhadapan dengan wakil tuan rumah, Christian Kirchmayr. (Nestri Yuniardi)', "
        
