['KOMPAS.com\xa0- Pasangan ganda campuran Indonesia,  Tontowi Ahmad/ Winny Oktavina Kandow, berhasil melaju ke perempat final  All England Open 2019 setelah mengalahkan wakil Malaysia, Chan Peng Soon/Goh Liu Ying.', 'KOMPAS.com\xa0', 'Tontowi Ahmad', 'Winny Oktavina Kandow', 'All England', 'Bertanding di Birmingham, Inggris, Kamis (7/3/2019), Tontowi/Winny menang dalam dua gim langsung dengan skor 21-15, 16-21, dan 23-21.', 'Pada awal gim pertama, Tontowi/Winny sempat tertinggal 0-1, lalu perolehan poin menjadi sama kuat 3-3.', 'Setelah itu Tontowi/Winny mulai bisa mengendalikan laga dengan selalu unggul dalam perolehan poin.', 'Beberapa kali penempatan kok dari Tontowi/Winny sulit dikembalikan Chan Peng Soon/Goh Liu Ying.', 'Interval gim pertama ditutup dengan skor 11-10 untuk keunggulan Tontowi/Winny.', 'Setelah interval, Tontowi/Winny tetap bisa menjaga fokus. Mereka unggul 15-11. Beberapa kali pukulan dari Tontowi/Winny tak bisa dikembalikan dengan baik. Mereka pun menutup gim pertama dengan skor 21-15.', 'Baca juga: Hasil All England 2019, Ahsan/Hendra Melaju ke Perempat Final', 'Baca juga: Hasil All England 2019, Ahsan/Hendra Melaju ke Perempat Final', 'Baca juga: Hasil All England 2019, Ahsan/Hendra Melaju ke Perempat Final', 'Hasil All England 2019, Ahsan/Hendra Melaju ke Perempat Final', '', 'Pada gim kedua, laga berlangsung ketat. Beberapa kali terjadi perolehan poin yang sama, yakni 3-3 dan 5-5.', 'Namun, setelah itu, pasangan Malaysia beberapa kali bisa menekan Tontowi/Winny. Interval gim kedua ditutup dengan skor 9-11 untuk Chan Peng Soon/Goh Liu Ying.', 'Setelah interval, Tontowi/Winny belum bisa keluar dari tekanan. Mereka tertinggal 12-15.', 'Mendapat momentum, Chan Peng Soon/Goh Liu Ying bisa mengendalikan laga hingga unggul pada gim itu dengan skor 21-16.', 'Baca juga: Perayaan Nyepi ala Ni Ketut pada Turnamen All England Open 2019', 'Baca juga: Perayaan Nyepi ala Ni Ketut pada Turnamen All England Open 2019', 'Perayaan Nyepi ala Ni Ketut pada Turnamen All England Open 2019', 'Pada gim penentuan, laga kembali berlangsung sengit. Sempat tertinggal 2-4, Tontowi/Winny kemudian bisa menyamakan kedudukan menjadi 6-6 dan 7-7.', 'Bahkan, mereka bisa menyalip perolehan poin lawan dengan skor 9-8 dan menutup interval gim ketiga dengan skor 11-9.', 'Setelah interval, permainan ketat masih terjadi. Baik Tontowi/Winny maupun\xa0Chan Peng Soon/Goh Liu Ying bergantian memperoleh poin.', 'Sempat terjadi poin sama 17-17 dan 18-18. Beruntung,\xa0Tontowi/Winny tetap bisa menjaga fokus dan mengakhiri laga dengan kemenangan 23-21.', "
        
