['BIRMINGHAM, KOMPAS.com - Pasangan ganda putra Indonesia,  Mohammad Ahsan/ Hendra Setiawan, berhasil melaju ke babak perempat final turnamen bulu tangkis  All England Open 2019.', 'BIRMINGHAM, KOMPAS.com', 'Mohammad Ahsan', 'Hendra Setiawan', 'All England Open 2019', 'Ahsan/Hendra lolos setelah meraih kemenangan 21-19, 21-18 atas pasangan Rusia, Valdimir Ivanov/Ivan Sozonov, pada laga babak kedua yang berlangsung di Arena Birmingham, Inggris, Kamis (7/3/2019).', 'Baca juga: Lampaui Target, NSH Jakarta Kini Bidik Gelar Juara IBL', 'Baca juga: Lampaui Target, NSH Jakarta Kini Bidik Gelar Juara IBL', 'Lampaui Target, NSH Jakarta Kini Bidik Gelar Juara IBL', 'Pada awal gim pertama, Ivanov/Sozonov sempat mendominasi permainan. Terbukti, mereka membuka laga dengan mencetak tiga angka beruntun.', 'Namun, Ahsan/Hendra sukses membalasnya dan membuat skor pertandingan menjadi imbang 3-3. Setelah itu, mereka pun mulai menemukan ritme permainan.', 'Lima poin beruntun dibukukan Ahsan/Hendra sehingga mereka bisa memimpin 11-6 saat fase interval.', 'Pada pengujung gim pertama, Ivanov/Sozonov sempat memangkas selisih skor menjadi hanya dua angka (16-18). Meski demikian, Ahsan/Hendra mampu mempertahankan keunggulan hingga akhir fase.', 'Memasuki gim kedua, baik Ahsan/Hendra maupun Ivanov/Sozonov bermain cukup sengit. Merea silih berganti mencetak angka hingga papan skor menunjukkan perolehan 3-3.', 'Akan tetapi, Ahsan/Hendra lagi-lagi menunjukkan pengalamannya. Mereka tampil lebih konsisten dan sanggup memimpin 11-8 saat jeda istirahat.', 'Setelah interval, Ivanov/Sozonov mencoba bangkit. Perlahan namun pasti, mereka mulai mengimbangi permainan pasangan Indonesia.', 'Hasilnya, Ivanov/Sozonov sempat memimpin 16-15. Kendati begitu, Ahsan/Hendra tetap mencoba tenang karena mereka akhirnya bisa unggul kembali.', 'Persaingan sengit masih berlangsung hingga akhir gim kedua. Ivanov/Sozonov masih menunjukkan perlawanan ngotot untuk memaksa laga ke gim ketiga.', 'Baca juga: Perayaan Nyepi ala Ni Ketut pada Turnamen All England Open 2019', 'Baca juga: Perayaan Nyepi ala Ni Ketut pada Turnamen All England Open 2019', 'Perayaan Nyepi ala Ni Ketut pada Turnamen All England Open 2019', 'Namun, Ahsan/Hendra tetap bermain fokus. Mereka pun memastikan kemenangan 21-18 pada gim kedua.', 'Bagi Ahsan/Hendra, ini adalah kemenangan kelima mereka atas Ivanov/Sozonov. Sebelumnya, kedua pasangan bertemu pada Indonesia Open 2013, Hongkong Open 2013, All England Open 2014, dan Japan Open 2015.', "
        
