['BIRIMINGHAM, KOMPAS.com - Pasangan ganda putra Indonesia,  Fajar Alfian/ Muhammad Rian Ardianto, turut melaju ke babak perempat final turnamen  All England Open 2019.', 'BIRIMINGHAM, KOMPAS.com', 'Fajar Alfian', 'Muhammad Rian Ardianto', 'All England Open 2019', 'Fajar/Rian, yang merupakan unggulan ke delapan turnamen, lolos setelah menang 13-21, 21-19, 23-21 atas pasangan China,\xa0Ou Xuanyi/Ren Xiangyu, pada laga babak kedua di Arena Birmingham, Inggris, Kamis (7/3/2019).', 'Fajar/Rian lolos ke perempat final, mengikuti jejak sang senior, Mohammad Ahsan/Hendra Setiawan, yang sudah lebih dulu melaju.', 'Jalannya pertandingan', 'Jalannya pertandingan', 'Pada awal gim pertama, kedua pasangan sempat bersaing sengit. Mereka silih berganti mendulang poin hingga papan skor menunjukkan angka imbang 4-4.', 'Setelah itu, Fajar/Rian mulai menunjukkan tajinya. Empat angka beruntun ditorehkan dan membawa mereka unggul 8-4 atas Ou/Ren.', 'Namun, jelang turun minum, performa Fajar/Rian mengendur. Permainan efektif yang ditampilkan Ou/Ren membuat mereka berbalik unggul hingga 19-11.', 'Selisih poin yang cukup jauh membuat Fajar/Rian kesulitan memaksimalkan kesempatan yang ada. Gim pertama pun menjadi milik Ou/Ren dengan skor 21-13.', 'Memasuki gim kedua, Fajar/Rian mencoba untuk membayar kekalahan. Mereka berjuang keras untuk meredam permainan sengit dari Ou/Ren.', 'Setelah kedua pasangan bergantian mencetak poin pada awal gim kedua, Fajar/Rian mulai menemukan ritme permainan setelah interval.', 'Meskipun Ou/Ren masih memberikan perlawanan ketat, Fajar/Rian terbukti tampil lebih konsisten dan mampu menyudahi gim kedua dengan kemenangan 21-19.', 'Baca juga: Hasil All England 2019, Tontowi/Winny Tembus Perempat Final', 'Baca juga: Hasil All England 2019, Tontowi/Winny Tembus Perempat Final', 'Hasil All England 2019, Tontowi/Winny Tembus Perempat Final', 'Pertandingan pun berlanjut ke gim ketiga. Pada fase ini, kedua pasangan benar-benar ngotot menampilkan performa impresif.', 'Sejak awal hingga pengujung gim ketiga, mereka bergantian mencetak angka, memanfaatkan kecerobohan yang dilakukan lawan mereka masing-masing.', 'Papan skor pun sampai menunjukkan angka 18-18. Namun, pada momen genting inilah, Fajar/Rian menunjukkan kepiawaian mereka.', 'Setelah bersusah payah meladeni perlawanan Ou/Ren pada pengujung laga, Fajar/Rian akhirnya menyudahi gim ketiga dengan kemenangan 23-21.', "
        
