['BIRMINGHAM, KOMPAS.com - Pemain ganda campuran muda Indonesia,  Winny Oktavina Kandow, mengaku awalnya merasa terbebani dipasangkan dengan pebulu tangkis senior sekaliber  Tontowi Ahmad.', 'BIRMINGHAM, KOMPAS.com', 'Winny Oktavina Kandow', 'Tontowi Ahmad', 'Pernyataan itu disampaikan Winny usai keberhasilannya bersama Tontowi menyingkirkan unggulan kelima asal Malaysia, Chan Peng Soon/Goh Liu Ying, pada babak kedua  All England Open 2019, di Arena Birmingham, Inggris, Kamis (7/3/2019).', 'All England Open 2019', 'Tontowi/Winny menang dengan skor rubber game 21-15, 16-21, 23-21, dan mereka pun berhak lolos ke babak perempat final.', 'rubber game', 'Baca juga: Hasil All England 2019, Tontowi/Winny Tembus Perempat Final', 'Baca juga: Hasil All England 2019, Tontowi/Winny Tembus Perempat Final', 'Hasil All England 2019, Tontowi/Winny Tembus Perempat Final', '"Berpasangan (sama Tontowi) awalnya beban, tetapi ketika tanding sudah tidak. Bang Owi kalau ngasih tahu tuh santai, lebih kayak ke teman," kata Winny seusai laga, seperti dikutip dari Badminton Indonesia.', 'Tontowi/Winny yang tampil lepas dan tanpa beban, berhasil memporak porandakan pertahanan Chan/Goh.', 'Pasangan Malaysia tersebut sampai harus jatuh bangun menghadapi serangan Tontowi/Winny yang sebetulnya tak terlalu agresif, tetapi penempatannya sulit diantisipasi.', 'Meski demikian, Tontowi menilai kerja samanya dengan Winny masih harus ditingkatkan. Ia masih terus membimbing Winny, terutama saat poin-poin kritis.', '"Tadi saya hanya bilang, kalau poin kritis, apalagi di kejuaraan penting, mati boleh, tetapi kita harus dalam keadaan siap. Kalau tadi kan matinya kami nggak siap. Jadi Winny kalau di poin kritis tadi harus siap," ujar Tontowi.', '"Dari awal, strategi kami sudah benar, tetapi di game kedua kami terpancing pola main lawan. Pada game ketiga, kami diberi instruksi sama pelatih dan bisa kembali menjalankan strategi seperti game pertama. Kami unggul di strategi, tetapi nggak bisa dibocorkan apa strateginya," ucap Tontowi.', 'game', 'game', 'game', 'Baca juga: Hasil All England 2019, Fajar/Rian Turut Lolos ke Perempat Final', 'Baca juga: Hasil All England 2019, Fajar/Rian Turut Lolos ke Perempat Final', 'Hasil All England 2019, Fajar/Rian Turut Lolos ke Perempat Final', 'Selain Tontowi/Winny, Mohammad Ahsan/Hendra Setiawan dan Fajar Alfian/Muhammad Rian Ardianto dari sektor ganda putra juga sukses melaju ke babak perempat final.', 'Saat artikel ini ditulis, masih ada beberapa wakil Indonesia lain yang belum tampil atau masih bermain, yakni Tommy Sugiarto (tunggal putra), Jonatan Christie (tunggal putra), Ni Ketut Mahadewi Istarani/Rizki Amelia Pradipta (ganda putri), Greysia Polii/Apriyani Rahayu (ganda putri), dan Praveen Jordan/Melati Daeva Oktavianti (ganda campuran).', "
        
