['JAKARTA, KOMPAS.com - Penampilan  NSH Jakarta pada IBL Pertamax 2018-2019 benar-benar di luar dugaan. Berstatus tim "kuda hitam" atau non-unggulan, mereka justru mampu tampil impresif sepanjang babak reguler.', 'JAKARTA, KOMPAS.com', 'NSH Jakarta', 'Pada fase reguler, tim asuhan  Wahyu Widayat Jati itu sukses memimpin klasemen Divisi Merah dengan catatan 12 kemenangan dan enam kekalahan (30 poin).', 'Wahyu Widayat Jati', 'Dengan pencapaian tersebut, NSH pun berhak langsung lolos ke babak semifinal dan akan berhadapan dengan Satria Muda Pertamina Jakarta.', 'Baca juga: Lawan Stapac Jakarta, Pacific Caesar Optimistis Hadapi Semifinal IBL', 'Baca juga: Lawan Stapac Jakarta, Pacific Caesar Optimistis Hadapi Semifinal IBL', 'Lawan Stapac Jakarta, Pacific Caesar Optimistis Hadapi Semifinal IBL', 'Rekor pertemuan NSH dengan Satria Muda pada musim ini terbilang positif. Dari dua pertemuan di babak reguler, NSH sukses menuntaskannya dengan kemenangan.', 'Performa apik pun membuat para pemain dan pelatih NSH merasa percaya diri dan mereka pun mulai berani menargetkan gelar juara musim ini.', '"Mereka (Satria Muda) adalah tim papan atas dan sudah punya mental juara, sementara kami baru mencoba naik kelas jadi tim papan atas," kata Wahyu yang juga akrab disapa dengan nama Cacing.', '"Namun, kami akan tetap bekerja keras menghadapi mereka. Target masuk play-off sudah tercapai, bahkan melebihi. Kami pun ingin masuk final dan menjadi juara," kata dia.', 'play-off', 'Cacing tak memungkiri, di atas kertas, materi pemain NSH memang kalah jika dibandingkan dengan skuad Satria Muda yang sarat pengalaman.', 'Meski demikian, Cacing tetap percaya dengan kemampuan para pemainnya. Ia optimistis NSH bisa berbicara banyak saat menghadapi sang juara bertahan.', '"Bench player mereka lebih merata. Saya akan coba siapkan pemain-pemain pelapis kami agar lebih siap bertanding di babak semifinal," ucap Cacing.', 'Bench player', 'NSH memang menunjukkan peningkatan performa yang signifikan jika dibandingkan dengan musim lalu.', 'Baca juga: Perayaan Nyepi ala Ni Ketut pada Turnamen All England Open 2019', 'Baca juga: Perayaan Nyepi ala Ni Ketut pada Turnamen All England Open 2019', 'Perayaan Nyepi ala Ni Ketut pada Turnamen All England Open 2019', 'Pada musim lalu, mereka hanya mencatat dua kali kemenangan. Akan tetapi, pada musim ini, Wendha Wijaya dkk mampu menjadi juara divisi.', 'NSH memiliki dua pemain asing yang tampil impesif, yakni Deshaun Wiggins (guard) dan Anthony Simpson (center). Selain itu, sejumlah pemain lokal mereka juga bermain apik, salah satunya Andre Rorimpandey.', 'guard', 'center', "
        
