['BIRMINGHAM, KOMPAS.com - Wakil ganda putri Indonesia, Greysia Polii/Apriyani Rahayu, meraih tiket ke babak perempat final  All England Open 2019.', 'BIRMINGHAM, KOMPAS.com', 'All England Open 2019', 'Greysia/Apriyani berhasil mengalahkan wakil dari China Dong Wenjing/Feng Xueying pada laga babak kedua yang digelar di Arena Birmingham, Inggris, Kamis (7/3/2019) atau Jumat dini hari WIB dengan skor akhir 21-10 dan 21-12.', 'Pada gim pertama, Greysia/Apriyani sudah unggul sejak awal laga atas Dong/Feng dengan skor 4-2.', 'Pasangan Indonesia itu terus mengungguli lawannya hingga jeda interval yang berakhir dengan skor 11-4.', 'Baca juga: Hasil All England Open 2019 - Ketut/Rizki Raih Tiket ke Perempat Final', 'Baca juga: Hasil All England Open 2019 - Ketut/Rizki Raih Tiket ke Perempat Final', 'Hasil All England Open 2019 - Ketut/Rizki Raih Tiket ke Perempat Final', 'Tertinggal jauh, Dong/Feng sempat memperkecil jarak setelah jeda interval dengan mengubah jarak skor menjadi 14-8.', 'Namun, Greysia/Apriyani berhasil mengakhiri gim pertama dengan keunggulan 21-10 atas Dong/Feng.', 'Pada awal gim kedua, Greysia/Apriyani dan Dong/Feng sempat saling kejar skor.', 'Namun, Greysia berhasil memimpin sementara dengan skor 6-3. Dong/Feng sempat menyamakan kedudukan menjadi 8-8. Namun, lagi-lagi pasangan Indonesia masih unggul hingga jeda interval dengan skor 11-8.', 'Selepas jeda, Greysia/Apriyani makin mendominasi pertandingan sehingga gim kedua ini berakhir dengan skor 21-12.', 'Dengan hasil tersebut, Greysia Polii/Apriyani Rahayu melaju ke babak perempat final dan akan menghadapi Chen Qingchen/Jia Yifan (China).', "
        
