['BIRMINGHAM, KOMPAS.com - Ganda putri Indonesia,  Ni Ketut Mahadewi Istarani/ Rizki Amelia Pradipta melaju ke perempat final seusai kalahkan wakil Korea Selatan Chang Ye Na/Jung Kyung Eun pada babak kedua ganda putri  All England Open 2019.', 'BIRMINGHAM, KOMPAS.com', 'Ni Ketut Mahadewi Istarani', 'Rizki Amelia Pradipta', 'All England Open 2019', 'Ni Ketut Mahadewi Istarani/Rizki Amelia Pradipta mengalahkan Chang Ye Na/Jung Kyung Eun pada laga yang digelar di Arena Birmingham, Inggris, Kamis (7/3/2019) atau Jumat dini hari WIB dengan skor akhir 21-13, 21-11.', 'Ketut/Rizki sejak awal gim pertama sudah memimpin terlebih dahulu. Mereka berhasil membuka keunggulan hingga skor menjadi 3-1.', 'Baca juga: All England Open 2019 - Tommy Sugiarto Pastikan Tempat di 8 Besar', 'Baca juga: All England Open 2019 - Tommy Sugiarto Pastikan Tempat di 8 Besar', 'All England Open 2019 - Tommy Sugiarto Pastikan Tempat di 8 Besar', 'Sempat saling kejar-kejaran skor, Ketut/Rizki unggul hingga jeda interval pertama dengan skor 11-7.', 'Selepas jeda, pasangan ganda putri Indonesia itu terus unggul dan mengakhiri gim pertama dengan skor 21-13.', 'Pada gim kedua, Chang/Jung sempat memimpin terlebih dahulu dengan skor 0-2.', 'Namun, Ketut/Rizki berhasil menyamakan kedudukan menjadi 2-2. Pasangan Indonesia itu bahkan tersebut terus unggul hingga jeda interval dengan skor 11-5.', 'Hingga gim kedua berakhir, Ketut/Rizki unggul atas Chang/Jung dengan skor akhir 21-11.', 'Dengan hasil ini, Ni Ketut Mahadewi Istarani/ Rizki Amelia Pradipta berhasil melaju ke babak perempat final All England Open 2019 dan akan menghadapi pasangan Jepang, yaitu Shiho Tanaka/Koharu Yonemoto.', "
        
