['LOS ANGELES, Kompas.com - Juara kelas bulu UFC, Max Holloway tidak ingin kehilangan kesempatan lagi untuk menghadapi juara kelas ringan asal Rusia,\xa0  Khabib Nurmagomedov.', 'LOS ANGELES, Kompas.com', 'Khabib Nurmagomedov', 'Holloway pernah tiga kali memiliki kesempatan berhadapan dengan Khabib, namun gagal karena beberapa alasan. Holloway (20-4 MMA, 16-4 UFC) akan naik ke kelas ringan untuk menghadapi Dustin Poirier (24-5 MMA, 16-4 UFC) dalam perebutan gelar juara interim pada UFC 236. ', 'Juara kelas ringan sejati, Khabib Nurmagomedov (27-0 MMA, 11-0 UFC) saat ini tengah menjalani hukuman larangan bertarung selama sembilan bulan menuyusul keributan pada UFC 229, Oktober tahun lalu.', 'Pihak UFC kemudian menawarkan Holloway untuk memperebutkan gelar juara interim menghadapi Poirier. Petarung ini pernah mengalahkan Holloway\xa0 pada UFC 223, April 2018.', 'Menurut Holloway, pertarungan menghadapi Poirier merupakan pintu baginya untuk menghadapi Khabib. "Khabib bilang ia akan menghadapi saya bila saya sudah membuktikan saya layak," kata Holloway.\xa0 "Saya akan menghadapi Dustin, pada 13 April ini untuk membuktikan siapa saya. Jadi pada saatnya Khabib siap bertarung lagi, saya sudah siap."', 'UFC 236 akan berlangsung di State Farm Arena, Atlanta pada 13 April mendatang. Poirier mengalahkan Holloway pada UFC 143, Februari 2012, namun sejak kekalahan tersebut karir Holloway justru semakin hebat dengan antara lain dua kali mengalahkan petarung Brasil, Jose Aldo.', 'Saat ini, Holloway mengaku hanya berkonsentrasi untuk pertarungan menghadapi Poirier. "Setelah pertarungan menghadapi Ortega, mereka menawarkan pertarungan 13 April ini," kata Holloway. "Setelah menghadapi dia, saya baru akan berpikir soal pertarungan yang lain."', "
        
