['', '', 'BIRMINGHAM, KOMPAS.com -\xa0 Tommy Sugiarto melangkah ke babak perempat final  All England 2019 seusai meraih hasil positif pada pertandingan babak kedua, Kamis (7/3/2019).\xa0', 'BIRMINGHAM, KOMPAS.com -\xa0', 'Tommy Sugiarto', 'All England', 'Tommy Sugiarto menang atas wakil China, Huang Yuxiang. Dia harus melewati pertarungan tiga gim, 22-24, 21-17, 21-16.', 'Dia menjadi wakil keempat Indonesia pada babak perempat final All England Open 2019. Dia menyusul Mohammad Ahsan/Hendra Setiawan, Fajar Alfian/Muhammad Rian Ardianto, dan Tontowi Ahmad/Winny Oktavina Kandow yang lebih dulu lolos.', 'Baca juga: Winny Oktavina Awalnya Terbebani Dipasangkan dengan Tontowi', 'Baca juga: Winny Oktavina Awalnya Terbebani Dipasangkan dengan Tontowi', 'Winny Oktavina Awalnya Terbebani Dipasangkan dengan Tontowi', 'Duel Tommy Sugiarto vs Huang Yuxiang berlangsung ketat. Kedua pemain kerap susul menyusul angka dan menyamakan kedudukan.', 'Tommy sempat unggul usai lepas dari skor imbamg 11-11. Namun, Huang Yixiang terus mengejar dan skor kembali imbang 16-16.', 'Keadaan imbang bahkan terjadi hingga interval 22-22. Namun, Huang-lah yang lebih dulu keluar dari tekanan dan meraih dua poin tambahan dan dimenanginya dengan 24-22.', 'Memasuki gim kedua, Tommy lagi-lagi tertinggal. Dia sempat tertahan pada poin ke-5 dan tertinggal 5-10.', 'Dia pelan-pelan bangkit dan ganti meraih poin beruntun untuk menyamakan skor menjadi 10-10. Sukses menyamakan angka dengan Huang seperti melecut semangat Tommy untuk meraih 5 poin tambahan.', 'Baca juga: Hasil All England 2019, Fajar/Rian Turut Lolos ke Perempat Final', 'Baca juga: Hasil All England 2019, Fajar/Rian Turut Lolos ke Perempat Final', 'Hasil All England 2019, Fajar/Rian Turut Lolos ke Perempat Final', 'Artinya, dari perolehan angka ke-5, Tommy meraih 10 angka beruntun! Dia pun berbalik unggul 16-10. Keadaan di atas angin membuat Tommy tanpa kesulitan mempertahankan keunggulan untuk meraih poin-poin tersisa.', 'Sebaliknya, Huang hanya sanggup membukukan 7 angka tambahan.\xa0 Tommy pun memenangi laga gim kedua dengan 21-17 dan membuat laga berlanjut ke gim ketiga.', 'Gim ketiga diawali Tommy dengan cukup baik. Dia sempat terkejar oleh Huang, akan tetapi bisa mengembalikan keunggulan menjadi 11-9. Keadaan berbalik pada skor 13-13.', 'Huang meraih dua angka beruntun dan unggul 15-15. Tidak tinggal diam, Tommy ganti membalas dengan tiga poin tambahan dan unggul 16-15.', 'Tommy kembali tidak menyia-nyiakan keunggulan tersebut dan mendulang empat poin tambahan untuk mencapai match point. Huang sempat menjegal langkah Tommy dengan meraih satu angka tambahan.', 'Namun, Tommy bisa membalas dengan satu poin terakhir dan menutup gim ketiga dengan 21-16. Dia pun memastikan tempat di perempat final.\xa0(Lariza Oky Adisty)\xa0', '(Lariza Oky Adisty)\xa0', "
        
