['NONTHABURI, Kompas.com - Petenis Indonesia, Priska Madelyn Nugroho terhenti pada babak perempat final PTT - ITF Grade 1 di Nonthaburi, Thailand, Kamis (7/3)', 'NONTHABURI, Kompas.com', 'Unggulan kedua itu harus mengakui keunggulan wakil Ceko, Kristyna Lavickova. Priska kalah straight set dari seeded ke-10 itu, 4-6 2-6.', '"Tidak banyak peluang yang bisa saya ambil dalam pertandingan perempatfinal. Saya terkendala adanya blister di telapak kaki yang mengganggu performa," ucap Priska yang kini menempati peringkat ke-40 junior dunia.', 'Pekan depan, Priska akan melanjutkan kiprahnya di turnamen Sarawak Chief Minister ITF Junior Grade 1 di Kuching, Malaysia. "Saya butuh waktu untuk recovery . Mudah-mudahan\xa0 bisa tampil maksimal minggu depan. Dan gak ada halangan non teknis seperti yang saya hadapi sekarang," tutup Priska.', "
        
