['BIRMINGHAM, KOMPAS.com - Pebulu tangkis tunggal putra Indonesia,  Jonatan Christie, gagal melaju ke perempat final  All England Open 2019 setelah kalah dari Kidambi Srikanth pada laga babak kedua.', 'BIRMINGHAM, KOMPAS.com', 'Jonatan Christie', 'All England Open 2019', 'Bertanding di Arena Birmingham, Inggris, Kamis (7/3/2019), Srikanth mengalahkan Jonatan dengan skor rubber game 21-17, 11-21, 21-12.', 'rubber game', 'Baca juga: Hasil All England 2019, Tommy Sugiarto Melaju ', 'Baca juga: Hasil All England 2019, Tommy Sugiarto Melaju ', 'Hasil All England 2019, Tommy Sugiarto Melaju ', 'Srikanth tampil mendominasi pada gim pertama. Ia beberapa kali sukses melepaskan pukulan yang sulit diantisipasi oleh Jonatan.', 'Jonatan juga sempat melakukan penempatan bola yang menyulitkan Srikanth. Namun, ia juga kerap membuat kesalahan seperti bola tersangkut net dan keluar garis.', 'Situasi itu pun dimanfaatkan dengan baik oleh Srikanth. Gim pertama pun berhasil dimenangi pemain nomor delapan dunia itu dengan skor 21-17.', 'Kalah pada gim pertama, Jonatan mencoba bangkit pada gim kedua. Enam poin beruntun pun langsung dibukukan oleh pemain jebolan PB Tangkas tersebut.', 'Jonatan terus mempertahankan ritme permainannya. Ia pun berhasil menutup interval gim kedua dengan keunggulan 11-6.', 'Setelah interval, Srikanth terlihat semakin kesulitan dalam mengendalikan permainannya. Beberapa kali pukulannya out.', 'out', 'Rubber game pun terpaksa digelar setelah Jonatan mengantongi kemenangan gim kedua dengan kedudukan 21-11.', 'Rubber game', 'Pada gim penentuan, Srikanth kembali menemukan ritme permainannya. Empat poin beruntun yang diraih membawanya unggul 7-2 atas Jonatan.', 'Setelah interval, Srikanth semakin mendominasi. Sementara itu, Jonatan kembali melakukan sejumlah kesalahan.', 'Permainan konsisten yang ditampilkan Srikanth membawanya unggul hingga skor 19-10 atas Jonatan.', 'Baca juga: Dejan Antonic: Yang Punya Hati Lebih Besar Bisa Menangi Laga', 'Baca juga: Dejan Antonic: Yang Punya Hati Lebih Besar Bisa Menangi Laga', 'Dejan Antonic: Yang Punya Hati Lebih Besar Bisa Menangi Laga', 'Srikanth tak lagi kesulitan untuk melanjutkan tren positif tersebut. Ia berhasil menyudahi laga gim ketiga dengan kemenangan 21-12.', 'Dengan hasil ini, sektor tunggal putra Indonesia pun tinggal menyisakan Tommy Sugiarto.', "
        
